import React from 'react';
import './App.css';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Fretboard from './Fretboard';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }
  render() {
    return (
      <div className="App">
        <Router>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/Fretboard">Fretboard</Link>
                </li>
                <li>
                  <Link to="/">Suggest a scale!</Link>
                </li>
              </ul>
            </nav>
            <Switch>
              <Route exact path="/">
                <Home />
              </Route>
              <Route path="/Fretboard">
                <Fretboard />
              </Route>
              <Route path="/Fretboard">
                <Fretboard />
              </Route>
            </Switch>
          </div>
        </Router>
      </div>
    )
  }
}

function Home() {
  return <h2>Home</h2>;
}


export default App;
